        private static string ListToString(IList<int> list)
        {
            if (list.Count == 0) return "[]";

            var builder = new StringBuilder($"[{list[0]}");
            
            for (var i = 1; i < list.Count; i++)
            {
                builder.Append($", {list[i]}");
            }

            builder.Append("]");

            return builder.ToString();
        }
